"use strict";(self.webpackChunkunityquest_chronicles_of_love=self.webpackChunkunityquest_chronicles_of_love||[]).push([[8929],{41085:(t,e,o)=>{o.r(e),o.d(e,{default:()=>r,johnChapter5PL:()=>n});const n={chapter:5,title:"Jean 5",version:"Gda\u0144sk Bible 1632",language:"pl",direction:"ltr",verses:[{number:1,text:"Potem by\u0142o \u015bwi\u0119to \u017bydowskie, i wst\u0105pi\u0142 Jezus do Jeruzalemu.",strong:[]},{number:2,text:"A by\u0142a w Jeruzalemie przy rynku owczym sadzawka, kt\xf3ra si\u0119 zowie po Hebrajsku Betesda, maj\u0105ca pi\u0119\u0107 gank\xf3w.",strong:[{text:"brebis",strong:"G4263",start:38,end:44}]},{number:3,text:"W tych le\u017ca\u0142o mn\xf3stwo chorych, \u015blepych, chromych, usch\u0142ych, oczekuj\u0105cych poruszonej wody.",strong:[{text:"grand",strong:"G3173",start:38,end:43}]},{number:4,text:"Albowiem Anio\u0142 czasu pewnego zst\u0119powa\u0142 do sadzawki, i rusza\u0142 wod\u0119; a kto naprz\xf3d wst\u0105pi\u0142 po poruszeniu wody, zdrowym si\u0119 stawa\u0142, jak\u0105 by kolwiek chorob\u0105 by\u0142 zara\u017cony.",strong:[{text:"ange",strong:"G32",start:7,end:11},{text:"dans",strong:"H6887",start:41,end:45},{text:"premier",strong:"G4413",start:105,end:112}]},{number:5,text:"A by\u0142 tam cz\u0142owiek niekt\xf3ry, kt\xf3ry przez trzydzie\u015bci i osiem lat w niemocy le\u017ca\u0142.",strong:[{text:"homme",strong:"G444",start:18,end:23},{text:"malade",strong:"G772",start:24,end:30}]},{number:6,text:"Tego ujrzawszy Jezus le\u017c\u0105cego, i dowiedziawszy si\u0119, \u017ce ju\u017c przez d\u0142ugi czas by\u0142, rzek\u0142 mu: Chcesz\u017ce by\u0107 zdr\xf3w?",strong:[{text:"malade",strong:"G772",start:49,end:55}]},{number:7,text:"Odpowiedzia\u0142 mu chory: Panie! nie mam cz\u0142owieka, aby mi\u0119, gdy by woda by\u0142a poruszona, spu\u015bci\u0142 w sadzawk\u0119; a pok\u0105d ja przychodz\u0119, inszy st\u0105pi przede mn\u0105.",strong:[{text:"malade",strong:"G772",start:3,end:9},{text:"Seigneur",strong:"G2962",start:24,end:32},{text:"personne",strong:"G3762",start:42,end:50},{text:"dans",strong:"H6887",start:65,end:69}]},{number:8,text:"Rzek\u0142 mu Jezus: Wsta\u0144, we\u017amij \u0142o\u017ce twoje, a chod\u017a.",strong:[]},{number:9,text:"A natychmiast on cz\u0142owiek sta\u0142 si\u0119 zdr\xf3w, i wzi\u0105\u0142 \u0142o\u017ce swoje, i chodzi\u0142. A by\u0142o w on dzie\u0144 sabat.",strong:[{text:"homme",strong:"G444",start:13,end:18}]},{number:10,text:"Przeto\u017c m\xf3wili \u017bydowie onemu, kt\xf3ry by\u0142 uzdrowion: Sabat jest, nie godzi si\u0119 tobie nosi\u0107 \u0142o\u017ca.",strong:[{text:"jour",strong:"H3117",start:11,end:15}]},{number:11,text:"Odpowiedzia\u0142 im: Ten, kt\xf3ry mi\u0119 uczyni\u0142 zdrowym, ten mi rzek\u0142: We\u017amij \u0142o\u017ce twoje, a chod\u017a.",strong:[]},{number:12,text:"I pytali go: Kt\xf3ry\u017c to jest on cz\u0142owiek, kt\xf3ry ci rzek\u0142: We\u017amij \u0142o\u017ce twoje, a chod\u017a?",strong:[{text:"homme",strong:"G444",start:31,end:36}]},{number:13,text:"Ale ten, kt\xf3ry by\u0142 uzdrowion, nie wiedzia\u0142, kto by by\u0142; albowiem Jezus by\u0142 ust\u0105pi\u0142 od zgromadzi\u0142a, kt\xf3re by\u0142o na onem miejscu.",strong:[{text:"foule",strong:"G3793",start:88,end:93}]},{number:14,text:"Potem znalaz\u0142 go Jezus w ko\u015bciele, i rzek\u0142 mu: Oto jeste\u015b zdr\xf3w; ju\u017c wi\u0119cej nie grzesz, aby ci\u0119 gorszego co nie spotka\u0142o.",strong:[{text:"dans",strong:"H6887",start:24,end:28},{text:"peur",strong:"H3372",start:94,end:98}]},{number:15,text:"Odszed\u0142 on cz\u0142owiek, i opowiedzia\u0142 \u017bydom, \u017ce Jezus jest, kt\xf3ry go uczyni\u0142 zdrowym.",strong:[{text:"homme",strong:"G444",start:4,end:9}]},{number:16,text:"A przeto\u017c prze\u015bladowali \u017bydowie Jezusa, i szukali, jakoby go zabili, i\u017c to czyni\u0142 w sabat.",strong:[{text:"jour",strong:"H3117",start:80,end:84}]},{number:17,text:"Ale Jezus im odpowiedzia\u0142: Ojciec m\xf3j a\u017c dot\u0105d dzia\u0142a, i ja dzia\u0142am.",strong:[]},{number:18,text:"Przeto\u017c daleko wi\u0119cej szukali go \u017bydowie zabi\u0107, i\u017c nie tylko \u0142ama\u0142 sabat, ale i Ojcem swoim nazywa\u0142 Boga, czyni\u0105c si\u0119 r\xf3wnym Bogu.",strong:[{text:"faire",strong:"G1080",start:56,end:61},{text:"Dieu",strong:"G2316",start:141,end:145},{text:"propre",strong:"G2398",start:150,end:156},{text:"Dieu",strong:"G2316",start:190,end:194}]},{number:19,text:"Tedy odpowiedzia\u0142 Jezus, i rzek\u0142 im: Zaprawd\u0119, zaprawd\u0119 powiadam wam: Nie mo\u017ce Syn sam od siebie nic czyni\u0107, tylko co ujrzy, \u017ce Ojciec czyni; albowiem cokolwiek on czyni, to i Syn tak\u017ce czyni.",strong:[{text:"parole",strong:"G3056",start:21,end:27},{text:"Fils",strong:"G5207",start:83,end:87},{text:"rien",strong:"G3762",start:96,end:100},{text:"faire",strong:"G1080",start:101,end:106},{text:"faire",strong:"G1080",start:149,end:154},{text:"tout",strong:"G3956",start:167,end:171},{text:"Fils",strong:"G5207",start:196,end:200}]},{number:20,text:"Bo Ojciec mi\u0142uje Syna, i pokazuje mu wszystko, co sam czyni, a wi\u0119ksze nad te poka\u017ce mu sprawy, aby\u015bcie si\u0119 wy dziwowali.",strong:[{text:"Fils",strong:"G5207",start:20,end:24},{text:"tout",strong:"G3956",start:40,end:44},{text:"dans",strong:"H6887",start:138,end:142}]},{number:21,text:"Albowiem jako Ojciec wzbudza umar\u0142e, i o\u017cywia, tak i Syn, kt\xf3re chce, o\u017cywia.",strong:[{text:"comme",strong:"G2531",start:5,end:10},{text:"Fils",strong:"G5207",start:66,end:70}]},{number:22,text:"Albowiem Ojciec nikogo nie s\u0105dzi, ale wszystek s\u0105d da\u0142 Synowi;",strong:[{text:"personne",strong:"G3762",start:16,end:24},{text:"tout",strong:"G3956",start:42,end:46},{text:"jugement",strong:"G2920",start:47,end:55},{text:"Fils",strong:"G5207",start:59,end:63}]},{number:23,text:"Aby wszyscy czcili Syna, jako czcz\u0105 Ojca. Kto nie czci Syna, nie czci Ojca, kt\xf3ry go pos\u0142a\u0142.",strong:[{text:"Fils",strong:"G5207",start:26,end:30},{text:"comme",strong:"G2531",start:31,end:36},{text:"Fils",strong:"G5207",start:85,end:89}]},{number:24,text:"Zaprawd\u0119, zaprawd\u0119 powiadam wam: \u017be kto s\u0142ucha s\u0142owa mego, a wierzy temu, kt\xf3ry mi\u0119 pos\u0142a\u0142, ma \u017cywot wieczny, i na s\u0105d nie przychodzi, ale si\u0119 przeni\xf3s\u0142 z \u015bmierci do \u017cywota.",strong:[{text:"parole",strong:"G3056",start:58,end:64},{text:"jugement",strong:"G2920",start:143,end:151},{text:"mort",strong:"H6757",start:177,end:181}]},{number:25,text:"Zaprawd\u0119, zaprawd\u0119 powiadam wam: I\u017c przychodzi godzina, a teraz jest, gdy umarli us\u0142ysz\u0105 g\u0142os Syna Bo\u017cego, a kt\xf3rzy us\u0142ysz\u0105, \u017cy\u0107 b\u0119d\u0105.",strong:[{text:"Fils",strong:"G5207",start:112,end:116},{text:"Dieu",strong:"G2316",start:120,end:124}]},{number:26,text:"Albowiem jako Ojciec ma \u017cywot sam w sobie, tak da\u0142 i Synowi, aby mia\u0142 \u017cywot sam w sobie.",strong:[{text:"comme",strong:"G2531",start:5,end:10},{text:"Fils",strong:"G5207",start:61,end:65},{text:"avoir",strong:"G1372",start:68,end:73}]},{number:27,text:"I moc mu da\u0142 i s\u0105d czyni\u0107, przeto i\u017c jest Synem cz\u0142owieczym.",strong:[{text:"juger",strong:"G2919",start:32,end:37},{text:"Fils",strong:"G5207",start:55,end:59},{text:"homme",strong:"G444",start:65,end:70}]},{number:28,text:"Nie dziwujcie si\u0119 temu; bo przychodzi godzina, w kt\xf3r\u0105 wszyscy, co s\u0105 w grobach, us\u0142ysz\u0105 g\u0142os jego;",strong:[{text:"dans",strong:"H6887",start:69,end:73}]},{number:29,text:"I wynijd\u0105 ci, kt\xf3rzy dobrze czynili, na powstanie \u017cywota, a kt\xf3rzy \u017ale czynili, na powstanie s\u0105du.",strong:[{text:"bien",strong:"H2896",start:24,end:28},{text:"jugement",strong:"G2920",start:113,end:121}]},{number:30,text:"Ja sam od siebie nie mog\u0119 nic czyni\u0107; jako s\u0142ysz\u0119, tak s\u0105dz\u0119, a s\u0105d m\xf3j jest sprawiedliwy; bo nie szukam woli mojej, ale woli Ojca, kt\xf3ry mi\u0119 pos\u0142a\u0142.",strong:[{text:"rien",strong:"G3762",start:11,end:15},{text:"faire",strong:"G1080",start:16,end:21},{text:"selon",strong:"G2531",start:35,end:40},{text:"jugement",strong:"G2920",start:72,end:80}]},{number:31,text:"Je\u017alibym ja \u015bwiadczy\u0142 sam o sobie, \u015bwiadectwo moje nie jest prawdziwe.",strong:[]},{number:32,text:"Inszy jest, kt\xf3ry \u015bwiadczy o mnie, a wiem, \u017ce prawdziwe jest \u015bwiadectwo, kt\xf3re \u015bwiadczy o mnie.",strong:[]},{number:33,text:"Wy\u015bcie byli pos\u0142ali do Jana, i \u015bwiadczy\u0142 prawdzie.",strong:[{text:"Jean",strong:"G2491",start:22,end:26}]},{number:34,text:"Ale ja nie od cz\u0142owieka bior\u0119 \u015bwiadectwo, wszak\u017ce to powiadam, aby\u015bcie byli zbawieni.",strong:[{text:"homme",strong:"G444",start:28,end:33},{text:"ceci",strong:"G3778",start:75,end:79}]},{number:35,text:"On by\u0142 \u015bwiec\u0105 pal\u0105c\u0105 i \u015bwiec\u0105c\u0105; a wy chcieli\u015bcie na czas ucieszy\u0107 si\u0119 w \u015bwiat\u0142o\u015bci jego.",strong:[{text:"Jean",strong:"G2491",start:0,end:4}]},{number:36,text:"Ale ja mam wi\u0119ksze \u015bwiadectwo nad Janowe; albowiem sprawy, kt\xf3re mi da\u0142 Ojciec, abym je wykona\u0142, te same sprawy, kt\xf3re ja czyni\u0119, \u015bwiadcz\u0105 o mnie, \u017ce mi\u0119 Ojciec pos\u0142a\u0142.",strong:[{text:"grand",strong:"G3173",start:29,end:34},{text:"Jean",strong:"G2491",start:48,end:52},{text:"accomplir",strong:"G4160",start:93,end:102}]},{number:37,text:"I Ojciec, kt\xf3ry mi\u0119 pos\u0142a\u0142, on \u015bwiadczy\u0142 o mnie. A ni\u015bcie nigdy ani g\u0142osu jego s\u0142yszeli, ani obliczno\u015bci jego widzieli.",strong:[]},{number:38,text:"I s\u0142owa jego nie macie w sobie mieszkaj\u0105cego; bo kt\xf3rego on pos\u0142a\u0142, temu wy nie wierzycie.",strong:[{text:"parole",strong:"G3056",start:6,end:12},{text:"demeure",strong:"H1004",start:16,end:23}]},{number:39,text:"Szukacie Pism; bo si\u0119 wam zda, \u017ce w nich macie \u017cywot wieczny, a one s\u0105, kt\xf3re \u015bwiadcz\u0105 o mnie.",strong:[{text:"avoir",strong:"G1372",start:49,end:54}]},{number:40,text:"Wszak\u017ce nie chcecie przyj\u015b\u0107 do mnie, aby\u015bcie \u017cywot mieli.",strong:[{text:"avoir",strong:"G1372",start:39,end:44}]},{number:41,text:"Chwa\u0142y od ludzi nie bior\u0119.",strong:[]},{number:42,text:"Ale pozna\u0142em was, \u017ce mi\u0142o\u015bci Bo\u017cej nie macie w sobie.",strong:[{text:"amour",strong:"G25",start:45,end:50},{text:"Dieu",strong:"G2316",start:54,end:58}]},{number:43,text:"Przyszed\u0142em w imieniu Ojca mego, a nie przyjmujecie mi\u0119; je\u017aliby inszy przyszed\u0142 w imieniu swojem, onego przyjmiecie.",strong:[{text:"propre",strong:"G2398",start:85,end:91}]},{number:44,text:"Jako\u017c wy mo\u017cecie wierzy\u0107, kt\xf3rzy chwa\u0142\u0119 jeden od drugiego bierzecie, a chwa\u0142y, kt\xf3ra jest od samego Boga, nie szukacie?",strong:[{text:"croire",strong:"G4100",start:20,end:26},{text:"Dieu",strong:"G2316",start:124,end:128},{text:"seul",strong:"G3439",start:129,end:133}]},{number:45,text:"Nie mniemajcie, abym ja na was skar\u017cy\u0142 przed Ojcem; jest, kt\xf3ry na was skar\u017cy, Moj\u017cesz, w kt\xf3rym wy ufacie.",strong:[]},{number:46,text:"Bo by\u015bcie wierzyli Moj\u017ceszowi, wierzyliby\u015bcie i mnie; bo on o mnie pisa\u0142.",strong:[]},{number:47,text:"A poniewa\u017c pismom jego nie wierzycie, jako\u017c s\u0142owom moim uwierzycie?",strong:[]}]},r=n}}]);
